Teaser:
Uruchom swoje programy C/C++ w ChATGPT, używając tego monitu. Jest to bardzo potężna zachęta do uruchamiania wszelkiego rodzaju języków kodowania bezpośrednio w przeglądarce internetowej za pomocą Chatgpt.

 Po prostu wpisz swój kod C lub C++, który chcesz uruchomić w monicie, a Chat-GPT wyświetli w odpowiedzi dane wyjściowe tego programu.

 Jest to przydatne, jeśli nie masz zainstalowanego kompilatora na swoim komputerze i chcesz przetestować jakiś kod teraz, możesz to zrobić za pomocą prostego monitu.

 Przykład dla kodu C++.
 #include <Istrumień>

 int main() {
  std::cout << "Witaj czat-gpt3" << std::endl;
  powrót 0;
 }
